import React from 'react';

const SearchFriend = ({friendDB}) => {

    
    return (
        <div>
            {friendDB.friend.map((searched) => (
                <>
                <img src={searched.image} />
                <div>{searched.userName}</div>
                <div>{searched.message}</div>
                </>
            ))}
        </div>
    )
};

export default SearchFriend
